import React from "react";

import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <>
      <NavLink
        to="/"
        activeStyle={{
          fontWeight: "bold",
          color: "red",
        }}
      >
        About
      </NavLink>
      <NavLink
        to="/contact"
        activeStyle={{
          fontWeight: "bold",
          color: "red",
        }}
      >
        Contact
      </NavLink>
    </>
  );
};

export default Navbar;
